import { Carousel } from "bootstrap";
import BookCard from "./booksDir/BookCard";

const Books = () => {
  return (
    <div className="container">
      <div className="row">
        <Carousel show={3.5} slide={3} swiping={true}>
          {
            BookCard.map((book) => {
              return(
              <div bookCard={book} key={book.id}>
              </div>
              )
            })
          }
        </Carousel>
      </div>
    </div>
  );
};

export default Books;
